import React from 'react'
import styled from 'styled-components'

let Flex = styled.div`

    display: flex;
        justify-content:center;
        align-items:center;
        flex-direction:column;

`
let Title = styled.h1`
    font-size: 3rem;
    color: #fff;
    margin: 0 auto;
    background:transparent;
`
let Cblock = styled.div`
    margin: 5rem auto;
    max-width: 600px;
    height:600px;
    width: 100%;
    display:flex;
    flex-direction:column;

    background-color:#6066FF;
    border-radius:15px;
`

let Clmn = styled.div`
margin: 40px auto;
    display:flex;
    background:transparent;


`
let NewForm = styled.form`

    display:flex;
    flex-direction:column;
`

let MyInput = styled.input`
    width: 20rem;
    height: 2rem;
    color:#fff;
    border:none;
    outline:none;
    border-radius:15px;
    padding: 0 1rem;

`
let ForInput = styled.div`
    margin-bottom: 20px;
`

export default function Register() {
  return (
    <Flex>
<Cblock>
<Title>Register</Title>
<Clmn>
<NewForm >
            <ForInput>
            <MyInput type='text'  placeholder='name' name='name'  />

            </ForInput>
            <ForInput>
            <MyInput type='email' placeholder='email' name='email'  />

            </ForInput>
            <ForInput>
            <MyInput type='number' placeholder='age' name='age'  />

            </ForInput>
            <ForInput>
            <MyInput type='password' placeholder='password' name='password'  />

            </ForInput>

    </NewForm>
</Clmn>

</Cblock>

    </Flex>
  )
}
